window.bookSummaryJSON = "<p>College graduate Valentina never expected to fall for the hot as hell and intimidating Derek Cole when she accepted his offer to rent his property.<br> <br> From cottage to mansion, Valentina is certain she doesn't deserve the fairytale unfolding. But Derek gets what he wants...and he wants her.<br> <br> He’s “the one” for her, but before she says I do, she has to survive a month long trip to his family’s estate in Atlanta. Gaining approval from four brothers and an over-protective mother might just be her hardest test yet.<br> <br> For billionaire Derek Cole, this homecoming is a chance to mend the damage he caused when he walked away from the family business.<br> <br> <b>Just when they think they have a handle on their happily ever after...their past and future collide.</b></p>"; 
